import React from 'react';

function App() {
    const title = 'Blog Post';
    const body = 'This is my blog post'
    return (
        <div className='container'>
            <h1>{title}</h1>
            <p>{body}</p>
            {Math.random() * 10}
        </div>
    )

}
export default App;
